CREATE TABLE SC_FIXTURE
(
  SC_GAME_ID 	INT NOT NULL,
  SEASON 		INT NOT NULL,
  ROUND 		INT NOT NULL,
  GAME_NO 		INT NOT NULL,
  HOME_FLAG		INT NOT NULL,
  SC_COACH_ID 	INT NOT NULL,
  ROUND_SCORE	INT,
  PRIMARY KEY 	(SC_GAME_ID, SC_COACH_ID),
  FOREIGN KEY 	(SEASON, SC_COACH_ID) REFERENCES SC_TEAMS(SEASON, SC_COACH_ID)
);






